    baseTypes: PropTypes.arrayOf(PropTypes.string),
    children: PropTypes.any,
    type: PropTypes.string,
  };

  static defaultProps = {
    baseTypes: ['ui-view-controller'],
    children: undefined,
    type: 'ui-view-controller',
  };

  render() {
    const {
      children,
      baseTypes,
      type,
      ...rest
    } = this.props;

    return (
      <BaseViewController
        {...rest}
        baseType={baseTypes}
        type={type}
      >
        {children}
      </BaseViewController>
    )
  }
}

